const Homepage = ()=>{

	const [myThing, setMyThing] = useState(0);

	const incrementThing = useCallback(() => setMyThing(myThing + 1),[])

	functions.add(incrementThing)
	console.log(functions);

	return(
		<HomePageContainer>
				<button onClick={incrementThing}>increment thing</button>
					{ myThing }
			<Directory/>
		</HomePageContainer>
	)
}

export default Homepage
